var Ejs = {};
Ejs.load = function() {

    ace.define('ace/snippets/ejs', ['require', 'exports', 'module' ], function(require, exports, module) {


        exports.snippetText = "";
        exports.scope = "ejs";

        });

};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Ejs', Ejs);